// Interface for orders
//"SPDX-License-Identifier: BUSL1.1"

pragma solidity 0.7.1;
pragma experimental ABIEncoderV2;

import '@balancer-labs/v2-vault/contracts/interfaces/IVault.sol';

interface IOrder {

    enum OrderType{ Market, Limit, Stop }

    enum OrderStatus{ Filled, PartlyFilled, Open, Cancelled, Expired }

    enum Order{ Buy, Sell } 

    struct order{
        IVault.SwapKind swapKind; 
        address tokenIn;
        address tokenOut;
        OrderType otype;
        Order order;
        OrderStatus status;
        uint256 qty;
        address party;
        uint256 price;  
        bytes32 ref;  
    }

    struct Params {
        OrderType trade;
        uint256 price;
    }

    function getPoolId() external view returns(bytes32);

    function getSecurity() external view returns (address);

    function getCurrency() external view returns (address);

    function getOrderRef() external view returns(bytes32[] memory);

    function cancelOrder(bytes32 ref) external;

    function editOrder( bytes32 ref,
                        uint256 _price,
                        uint256 _qty) external;    

    function orderFilled(bytes32 partyRef, bytes32 counterpartyRef, uint256 executionDate) external;

    function revertTrade(bytes32 _orderRef, uint256 _qty, IOrder.Order _order, uint256 executionDate) external;

    function getOrder(bytes32 _ref) external view returns(IOrder.order memory);

}
